import React from 'react';
import NavBar from '../components/NavBar.js';

function LandingPage() {
    return (
        <div>
            <NavBar />
            <div style={{ marginTop: '50px' }}>
                <h1>Study Space</h1>
                <p>Get into flow state.</p>
            </div>
        </div>
    );
}

export default LandingPage;
